Select bucket hats from the latest Stüssy & Our Legacy collection were individually hand-dyed in Los Angeles, California by Niki Tsukamoto at Lookout and Wonderland. Combinations of osage orange, chestnut bark, quebracho rojo, sappanwood, brazilwood, lac, organic indigo and myrobalan were used to achieve one-of-a-kind colors for the headwear. 

Stüssy & Our Legacy Workshop, available now worldwide.

@lookoutandwonderland
